package basics;

public class operators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int a=10;
	int b=5;
	int n=10;
	int i=n++ + n-- + --n + ++n + --n - --n + n++;
	//(10+11+9+10+9-8+8)
	System.out.println(i);
	System.out.println(a+b);
	System.out.println(a-b);
	}

}
